pragma solidity ^0.8.9;

contract ERC20 {
    string public name;
    string public symbol;

    constructor(string memory _name, string memory _symbol) {
        name = _name;
        symbol = _symbol;
    }

    function decimals() public pure returns (uint8) {
        return 18;
    }
}
